script: |
  super -f text -I q1489.spq | sort > q1489.out

inputs:
  - name: q1489.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 * col2 NOT BETWEEN + + 9 - + - col2 * - - ( - + ( + - col0 ) ) + - - col1 AND - col1;
  - name: tab2

outputs:
  - name: q1489.out
    data: |
      46	51	23
      64	77	40
      75	67	58
